    "city": null,
    "description": "Established in 2007, the Twoism Records netlabel is the official home of the One on Twoism mixed compilation series. OOT features exclusive new music from the independent artists of twoism.org, an unofficial but highly respected Board of Canada forum. Keeping with a collective ethos, all releases are free to download, or to purchase as a high quality physical release for a very reasonable price of $2,50 per CD.\n\nBack in 2006, twoism.org member, Boards of Dublin, had the idea to create a compilation of BoC remixes. This idea quickly evolved into a BoC inspired compilation, where artists from the forum could contribute new work. \n\nAlmost at once, the idea became a popular part of the IDM subculture and it quickly became clear that a second volume wasn't so much an ‘if’, but more of a ‘..how soon’? The number of tracks submitted grew almost exponentially and so the strategy had to grow too. Member Aesthetics, who already mixed the first volume as Grim on Mbient, became curator in chief, hand picking songs which best fitted the release. This proved a difficult task as the quality of tracks offered became higher and higher in standard. But did they still fit the flow of the entire release? Herein lay the rub, and the craft.",
