    "city": "Sydney",
    "description": "TOKYO DENMARK SWEDEN\r\n\r\nFormed in late 2011 and heavily influenced by a shared interest in all things dance/pop/electronic/Macbook Pro, TOKYO DENMARK SWEDEN are rising fast from newcomers to indie dance favourites. With their debut single “Little Quarters” attracting blogger love both at home and overseas and airplay on Triple J and community tastemakers FBi, Triple R and 4ZZZ, TOKYO DENMARK SWEDEN are more than ready for the rest of 2012. \r\n\r\nTOKYO DENMARK SWEDEN have just released their self titled debut EP, which features “Little Quarters” and their recent single “Lights Off” together with ”When It Breaks”, “Paper Sails” and “Comets”, all of which add up to a strong snapshot of the band. Their atmospheric electronic sound highlighted by a deft mix of majestic synth lines, soaring vocals and stinging guitar lines has been winning over audiences throughout the year. Their depth of sound and refreshing energy have shaped their live sets and earnt them supports with the likes of Parachute Youth, RÜFÜS and Pluto Jonze.\r\n\r\nThe EP and their growing live presence confirms TOKYO DENMARK SWEDEN as one of Australia’s most exciting up and coming bands. They continue the cause taking part in the \"When It Breaks tour\" which kicks off late November and travels to the main cities on the East Coast.\r\n\r\nDave Ruby Howe, music blogger (hyperbole.tv) and Triple J's assistant music director of Australian music recently wrote in the Canberra Times;\r\n“Sydney three-piece Tokyo Denmark Sweden prove good on their hype with a knack for tight tunes with an attention to atmospheres. New single Lights Off bubbles over with arpeggios and a distant guitar line, while references to such crowd-pleasing acts as Goldfrapp, Metric and Dragonette are apt for the group led by Amy Pes.”\r\n\r\n\u2028\r\nFor further information please contact:\r\nManagement – Andrew Penhallow - arpenhallow@westnet.com.au\r\nBookings – Rob Giovannoni - rob@selectmusic.com.au\r\nPublicity – Nik Tropiano - nik@reckoningentertainment.com\r\n\r\n\r\n\r\n--FACEBOOK--\r\nwww.facebook.com/tokyodenmarksweden\r\n\r\n--SOUNDCLOUD--\r\nsoundcloud.com/tokyodenmarksweden\r\n\r\n--YOUTUBE--\r\nwww.youtube.com/user/tokyodenmarksweden",
