    "description": "The Boy & Sister Alma are an electro-pop duo from Helena, Montana. Their music is a blend of nostalgic sounds and modern production, mixing styles of synthwave, ’80s pop and electro, italo disco, dreamwave and 21st century synth pop. While tapping into a variety of moods and genres, the group’s material consistently embodies a “new-retro” vibe with a cinematic flare.\n\nPress quotes: \n\n“The debut EP from The Boy & Sister Alma hit this week and it’s a highly recommended experience in 80s driven synth pop… one only needs to hear the complete aural magic of ‘Keep Your Head’ to fall in love with their sounds. For a debut EP this is massively promising for the future of The Boy & Sister Alma as I believe their honest and intimate sounds are perfectly suited to 80s oriented experiences and it’s these ideas and elements that shine throughout this release.”\n- Synthetix.FM (Aug 03, 2013)\n\n“I’m not sure what I expect music from Montana to sound like, but it surely isn’t The Boy and Sister Alma. Their new ep T B & S A was created entirely in Montana but is more in league with the Italo Disco revival and is a quality piece of work.”\n- West Coast Fix (Aug 15, 2013)",
