    "city": "Detroit",
    "description": "\n\n\"The New Album digs deep into an 80s-lover's sense of nostalgia and is a true successor to what I consider some of the 80's greatest pop moments, including those found on Scritti Politti's Cupid & Psyche 85, Prince's Purple Rain and Janet Jackson's Rhythm Nation 1814. Like the aforementioned, Electric Atlantic makes fantastic use of classic synthesizer technology, but the brilliance of it truly explodes from the speakers as a result of its union with Trinkaus' additional mastery of modern software and hardware. The end result is an album that's unique, inspired and fully-realized like nothing I've heard within any retro-inspired genres. The album is its own species altogether, and it's a beautiful beast to behold.\" - Synthetix.fm\n\n",
