    "description": "\"'Kasper Bjørke definitely makes art. Each production feels assured with the Scandinavian impacting a genuine sense of the cerebral into his music\" \n\nClash Music stated these lines about the critically acclaimed 4th solo album After Forever released in 2014 - with other medias such as MixMag chiming in and highlighting the 4th single Apart (feat. Sisy Ey) as Tune of the Month while stating: \"It´s nothing short of genius... Kasper's absolutely nailed it... this record has certainly proven itself to be his most potent work yet\". \n\nOn After Forever Kasper explored a new take on contemporary, melancholic synth pop; merging his productions into a multi coloured soundscape with echoes from Post Disco/Punk, Kraut and New Wave. The full remix version of the album entitled \"After Forever Revisited\" came a year later, in 2015, including luminary new versions from the likes of Michael Mayer, Superpitcher, Matt Karmil, A/Jus/Ted, Hotel Lauer and many more.\n\nWhile occasionally releasing on labels like Eskimo and Correspondant, Kasper continues to have a close relationship with the Hamburg based label Hfn Music, which also released his two previous long players: Standing on top of Utopia (2010) and Fool (2012) plus the EP Symptoms and the double compilation Remix Crusades (2007 - 2013), showcasing Kaspers broad spectrum as a remixer; from established underground artists like Rebolledo to international pop acts like Moby.\n\nAs a DJ, Kasper has performed at some of the most renowned clubs and venues in the world. From Panorama Bar and Watergate in Berlin to Rex and Social Club in Paris, Robert Johnson in Frankfurt, D-Edge in Sao Paolo, Fabric in London, Le Bain and Output in New York, Bardot and Electric Pickle in Miami - and international festivals like Sonar, Roskilde Festival, Iceland Airwaves and Calvi on the Rocks. Back home in Copenhagen, Culture Box has a special place in his heart; the longest running nightclub in town.\n\nOccasionally Kasper joins forces with icelandic friend Sexy Lazer to produce music as the camp outfit The Mansisters. They released their debut “E.P. Phone Home (EP)” on Canadian My Favorite Robot Records in 2012 and has since then released their weirdo dark dance via Correspondant and Relish Recordings.\n \nMost recently, Kasper has produced the solo album Polyester Skin, for the Danish artist Jacob Bellens and in the summer of 2016, Kasper will release a mini album - and also engage in some exciting, new collaborations... More info in the coming months...",
