    "city": "Berlin",
    "description": "Monoloc's Upcoming Gigs\r\nFri 15 Jul, 16 \r\nVexed, Ipse, Berlin, Germany\r\nSat 16 Jul, 16 \r\nEl Row, Fabrik, Madrid, Spain\r\nFri 29 Jul, 16 \r\nD!Club, Lausanne, Switzerland\r\nSat 30 Jul, 16 \r\nHeinz Gaul, Cologne, Germany\r\nSee the full listing here \r\n http://gigs.gigatools.com/u/Monoloc\r\n\r\nPowered by GigaTools\r\n\r\n\r\nMonoloc based in Germany/Frankfurt am Main started to produce his first sounds in 2001. \r\n\r\nA few years later he moved to a proper studio to zero in on his music productions. The new place and his inspiring studio neighbors created a perfect environment so that he was able to upgrade his skills increasingly. \r\n\r\nMonoloc´s vinyl debut came in October 2008 with the „In a Haze EP“ (Smallroom 01) \r\n\r\nHe released already on labels like CLR, Synewave, MultiVitamins, Micro.fon and Droid for example who get thrilled by his deep minimalistic techno sound consisting of organic and sometimes dark vocal elements. His keen sense for good sound let him always know how to produce tracks with his special personal touch or how to create a great ambience for the dancefloor . His music is slow, dark, energetic and danceable.\r\n\r\nMidyear 2008 he was ready to take it to the next level and founded his own label Smallroom Music. Artists like Maetrik, Alexi Delano, Elon , Ascion , Kane Roth, Mike Wall , Jan Hendez,, Brian Sanhaji, Emerson, Matt Star, Jon Seber and many more had released on his emerging label yet. As a label head he has focused till now on discovering fresh and innovative young talent artists. \r\n\r\nMonoloc is actually touring all around, visiting the best clubs of the scene. Above all festivals like Nature One, Rave on Snow, Day & Night, Ruhr in Love, Dom Mladih (Sarajevo) to name few. His DJ sets can be described as pumping and deep. \r\n\r\nHe has a string of E.P's and remixes lined up and has no intentions of slowing down\r\n\r\n",
