    "full_name": "Ellen Allien",
    "city": "Berlin",
    "description": "Wherever you find Ellen Allien, you find movement. Born in Berlin, living and working in Berlin and Ibiza, one of the planet’s most dynamic party scenes, her artistic home stands for one thing above all: freedom, in every aspect. DJ, musician, label manager, t-shirt designer and creative all-rounder – Ellen Allien has carved out her own space in all these roles, creating a unique universe.\nSince 1999 she has managed the label BPitch Control in Berlin, as well as the t-shirt range ellen allien. As a DJ she rocks clubs and festivals all around the world. She is a resident at DC10/ Ibiza and Nitsa/ Barcelona as well as at major festivals such as Melt/ Germany and tours worldwide with BPitch Control events. Her productions have even been performed at temples of contempory art such as the Centre Pompidou in Paris.\nShe is constantly exploring new aural worlds, most recently on her soundtrack album \"LISm\" (2013), her works “Dust” (2010) and “Sool” (2008) or in collaboration with Apparat in 2006 on “Orchestra Of Bubbles”. \nMost importantly she shares her enthusiasm with others: her creative base and label BPitch Control, her fellow musicians and of course her audience. For a long time now, Ellen Allien has been regarded as a fixed star in the electronic music galaxy. She is an extraordinary creature, a one-of-a-kind artist without whom Berlin’s vibrant electronic club landscape wouldn’t be the same. Fortunately someone thought of a suitably extraterrestrial name for her right at the start of her career: Allien. No name will ever suit her better.",
