    "description": "<b>BIO:</b>\r\n\r\nArtemiy Anrilov was born in 1977 in the most north city of Russia - Murmansk.\r\nHis interest in electronic music has arrived with acquiring\r\ngood-old-fashioned ZX-Spectrum computer, which one Artem used to\r\nproduce some primitive and weird sounds instead of playing primitive\r\ngames.\r\n\r\nAfter ZX-Spectrum he has got more serious computer gear it was PC AT\r\n386 and started to conquer different \"trackers\" such as Scream\r\nTracker, Impulse Tracker etc.\r\n\r\nIdea to start dj career has come in mind in 1996 year, so it has been started.\r\nBegan to play house / acid house, during 2-3 years through different\r\nstyles and sounds Artem has come to techno / minimal sound which\r\nbecame main nowadays.\r\n\r\nAfter moving to Moscow in 2002, Artem continues to develop his musical\r\ntastes and horizons.\r\nIn 2005 he meets people who are stands behind DeepMix Moscow Radio and\r\nparticipates in developing radiostation.\r\nIn 2006 in collaboration with his friends from Murmansk, San-Francisco\r\nand Moscow launches internet label \"Fragment\" which was mainly aimed\r\nto release russian minimal / techno electronic music.\r\n\r\nDuring last 3 years played in many russian and former USSR cities. Was\r\nresidient of legendary club \"Mix\". Recently played in \"Solyanka\" Club.\r\nNowadays Artem resident of RTS.FM internet radio, clubs: \"Arma 17\",\r\n\"Shanti, \"Propaganda\". Also he is with Vasiliy Bvoice organizer of monthly\r\n\"Fragment Sessions\" parties that takes place in club Shanty every\r\npre-last thursday of month.\r\n\r\nTaking part in project \"B.A.D.\" with Vasily BVoice and Alex Danilov.",
