    "description": "Kobobar расположен близ Анапы, в самом сердце Бугазской косы - полоса суши длиной около 12 километров и шириной 250—300 метров, протянувшаяся между Бугазским лиманом и Чёрным морем, находится на территории ландшафтного заказника «Благовещенская коса», созданного в 1995 году. Одно из самых живописных мест побережья, которое состоит из кварцевого песка, гальки, мелкого ракушечника, и подходит для отдыха и занятий спортом. \nЕвропейская кухня в сочетании с обслуживанием дарит посетителям ощущение уединенности, бар с достоинством оправдывает самые смелые пожелания своих гостей, а уютный интерьер располагает к отдыху и безмятежности. Морской воздух, дикий пляж, атмосфера современности в деталях помогут Вам укрыться от будничных забот, от города, и насладиться уникальной природой и приятной музыкой. Kobobar оснащен английской акустической системой \"Funktion-one\" и является единственным местом представляющим оборудование столь высокого уровня на площадках побережья и края.",
